var request = require('superagent');

var API_URL = '/api/';
var TIMEOUT = 10000;

function getEntityData(entity, query) {
    var url = makeUrl(entity);

    return get(url, query);
}

function postEntityData(entity, data) {
    var url = makeUrl(entity);

    return post(url, data);
}

function makeUrl(part) {
    return API_URL + part;
}

function get(url, query) {
    return request
        .get(url)
        .query(query)
        .timeout(TIMEOUT)
}

function post(url, data) {
    return request
        .post(url)
        .type('form')
        .send(data)
        .timeout(TIMEOUT)
}

module.exports = {
    getEntityData  : getEntityData,
    postEntityData : postEntityData
};

